프랑스어로 빵(Pain)이라 하면 겉이 딱딱하면서 밀+효모+소금 정도만 들어가 다소 신 맛이 나는 식사용 빵을 일컫는데, 이 집은 가게 이름대로 주로 이런 류의 빵을 잘하는 듯. 개인적으로 별로 선호하지 않음에도 깜빠뉴(5300), 치즈올리브치아바타(3200) 맛있고, 이런 종류의 빵(Pain)들을 활용한 잠봉뵈르(5300)와 쪽파크림치즈베이첼(5000)도 매우 훌륭함. 왠만한 빵들은 먹기 좋게 컷팅해주는 센스까지.

단, 달달한 빵종류인 비엔누아즈리(Viennoiserie)는 달기 조절이 좀 안되는 듯. 말차크림빵(3800)과 앙버터바게뜨(4500) 너무 달아서 좀 부담스러운 정도;;

